import { GoogleApiWrapper, Map, Marker } from "google-maps-react";
import React from "react";

const GoogleMap = (props) => {
  console.log(props);
const exactLocation ={
  city:{
    name:"Sundharban",
    lat: 345245,
    lng:2345234
  },
}

if(exactLocation.city.name === props.locationName){
  console.log(exactLocation.city.lng)
}
  const mapStyles = {
    width: "50%",
    height: "50%",
    border: "2px solid red",
  };

  return (
    <div>
      <Map
        google={props.google}
        zoom={8}
        style={mapStyles}
        initialCenter={{ lat: 23.810331, lng: 90.412521 }}
      >
        <Marker position={{ lat: 23.810331, lng: 90.412521 }} />
      </Map>
      <hr />
    </div>
  );
};

export default GoogleApiWrapper({
  apiKey: "AIzaSyA9OU-Yxhjj-yocOCSzwPAOQpPnAOLJBj8",
})(GoogleMap);
